import React from 'react';

import MoviesList from './components/MoviesList';
import './App.css';
import axios from 'axios';

function App() {
  const dummyMovies = []
  axios.get('https://swapi.dev/api/films/').then((res) => {
    console.log(res.data.results);s
    res.data.results.forEach(film => {
      dummyMovies.push(film)
    })
  })

  return (
    <React.Fragment>
      <section>
        <button>Fetch Movies</button>
      </section>
      <section>
        <MoviesList movies={dummyMovies} />
      </section>
    </React.Fragment>
  );
}

export default App;
